    // O(SW)
    public int numMatchingSubseq1(String S, String[] words) {
        List<int[]>[] list=new List[128];
        for (int i = 'a'; i <= 'z'; i++)
            list[i]=new ArrayList<>();
        for (int i = 0; i <words.length ; i++) 
            list[words[i].charAt(0)].add(new int[]{i, 1});
        int cnt=0;
        for (int i = 0; i < S.length(); i++) {
            List<int[]> advance=list[S.charAt(i)];
            list[S.charAt(i)]=new ArrayList<>();
            for (int j = 0; j < advance.size(); j++) {
                int[] w=advance.get(j);
                if(w[1]==words[w[0]].length()){
                    cnt++; continue;
                }
                list[words[w[0]].charAt(w[1])].add(new int[]{w[0], w[1]+1});
            }
        }
        return cnt;
    }



    //Straight forward  O(SNW)
    public int numMatchingSubseq(String S, String[] words) {
        int n=words.length, cnt=0;
        Map<String, Integer> map=new HashMap<>();
        for(String s:words)
            map.put(s, map.getOrDefault(s, 0)+1);
        words=new String[map.size()];
        int i1=0;
        for(String s:map.keySet()) words[i1++]=s;
        n=words.length;
        int[] idw=new int[n], ids=new int[n];
        boolean flag=true;
        while (flag){
            flag=false;
            for (int i = 0; i < n; i++) {
                if(idw[i]==words[i].length() || ids[i]==S.length()) continue;
                flag=true;
                if(words[i].charAt(idw[i])==S.charAt(ids[i])) idw[i]++;
                ids[i]++;
                if(idw[i]==words[i].length()) cnt+=map.get(words[i]);
            }
        }
        return cnt;
    }
